			new myAttaks = 0;

			if(PlayerFamAttackGZ[playerid][1] == tmpday) {
				if(FInfo[myFam][fTabDay] == tmpday) {
					myAttaks += FInfo[myFam][fTabAttaks];
				}
			}

			for(new i = 0; i < TOTAL_FAMILY_GANGZONES; i++) {
				if(FamGangZone[i][attack_family_id] == myFam && FamGangZone[i][attack_day] == PlayerFamAttackGZ[playerid][1]) {
					myAttaks++;
				}
			}
			if(myAttaks >= 3) {
				SendClientMessage(playerid, COLOR_RED, "[–û—à–∏–±–∫–∞] {ffffff}–í—ã –Ω–µ –º–æ–∂–µ—Ç–µ –Ω–∞–ø–∞–¥–∞—Ç—å –≤ —ç—Ç–æ—Ç –¥–µ–Ω—å, –ø–æ—Å–∫–æ–ª—å–∫—É —É –≤–∞—Å —É–∂–µ –∑–∞–ø–ª–∞–Ω–∏—Ä–æ–≤–∞–Ω–æ 3 –Ω–∞–ø–∞–¥–µ–Ω–∏—è –≤ —ç—Ç–æ—Ç –¥–µ–Ω—å.");
				SendClientMessage(playerid, COLOR_RED, "[–û—à–∏–±–∫–∞] {ffffff}–ê —Å–µ–º—å—è –º–æ–∂–µ—Ç –Ω–∞–ø–∞–¥–∞—Ç—å –Ω–µ –±–æ–ª–µ–µ —Ç—Ä–µ—Ö —Ä–∞–∑ –≤ –¥–µ–Ω—å. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –≤—ã–±—Ä–∞—Ç—å –¥—Ä—É–≥–æ–π –¥–µ–Ω—å –¥–ª—è –Ω–∞–ø–∞–¥–µ–Ω–∏—è.");
				PlayerFamSelectGZ[playerid] = -1;
				return 1;
			}

// –µ—Å–ª–∏ —á—É–∂–∞—è —Å–µ–º—å—è –∑–∞—â–∏—â–∞–ª–∞—Å—å —Å–µ–≥–æ–¥–Ω—è –∏–ª–∏ –±—É–¥–µ—Ç –∑–∞—â–∏—â–∞—Ç—Å—è - —Ç–æ –æ—à–∏–±–∫–∞
			new enemyDefenses = 0;
			if(PlayerFamAttackGZ[playerid][1] == tmpday) {
				if(FInfo[myFam][fTabDay] == tmpday) {
					enemyDefenses += FInfo[myFam][fTabDefenses];
				}
			}

			for(new i = 0; i < TOTAL_FAMILY_GANGZONES; i++) {
				if(FamGangZone[i][attack_family_id] != -1 && FamGangZone[i][family_id] == enemyFam && FamGangZone[i][attack_day] == PlayerFamAttackGZ[playerid][1]) {
					enemyDefenses++;
				}
			}
			if(enemyDefenses >= 3) {
				SendClientMessage(playerid, COLOR_RED, "[–û—à–∏–±–∫–∞] {ffffff}–í—ã –Ω–µ –º–æ–∂–µ—Ç–µ –Ω–∞–ø–∞–¥–∞—Ç—å –≤ —ç—Ç–æ—Ç –¥–µ–Ω—å, –ø–æ—Å–∫–æ–ª—å–∫—É –Ω–∞ —ç—Ç—É —Å–µ–º—å—é —É–∂–µ –∑–∞–ø–ª–∞–Ω–∏—Ä–æ–≤–∞–Ω–æ 3 –Ω–∞–ø–∞–¥–µ–Ω–∏—è –≤ —ç—Ç–æ—Ç –¥–µ–Ω—å.");
				SendClientMessage(playerid, COLOR_RED, "[–û—à–∏–±–∫–∞] {ffffff}–ê —Å–µ–º—å—è –º–æ–∂–µ—Ç –∑–∞—â–∏—â–∞—Ç—å—Å—è —Ç–æ–ª—å–∫–æ —Ç—Ä–∏ —Ä–∞–∑–∞ –≤ –¥–µ–Ω—å. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –≤—ã–±—Ä–∞—Ç—å –¥—Ä—É–≥–æ–π –¥–µ–Ω—å –¥–ª—è –Ω–∞–ø–∞–¥–µ–Ω–∏—è.");
				PlayerFamSelectGZ[playerid] = -1;
				return 1;
			}
